import React, { component } from "react";
import Link from "next/link";

class Navbar extends component {
    constructor(props) {
        super(props)
        this.props = props
    }

    render() {
        return (
            <nav>
                <div>
                    <ul>
                        <li><Link href="/"><a>Home</a></Link></li>
                        <li><Link href="/about"><a>About</a></Link></li>
                    </ul>
                </div>
            </nav>
        );
    }
}

export default Navbar
